  const {rendelesItems} = useContext(EtlapKontextus);
  
  return (
    <div className='Rendeles'> 
    <div>
      <h1>A te Rendel√©seid</h1> 
      </div>
      <div className='rendelesItems'>
        {Termekek.map((termek) => {
          if (rendelesItems[termek.id] !== 0) {
            return <RendelesItem  data={termek} />
          }
        })}
      </div>
    </div>

  )
}

